import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { tan } from "react-native-reanimated";
import Icon from "react-native-vector-icons/FontAwesome";
import CustomComponent from "./components/CustomComponent";

export default function App() {
  const prevFuelUp = undefined;
  const fuelUp = [
    {
      key: 1,
      date: "2021.08.31",
      mileage: 189790,
      volume: 36.06,
      price: 15755,
    },
    {
      key: 2,
      date: "2021.09.05",
      mileage: 190164,
      volume: 33.12,
      price: 15035,
    },
    {
      key: 3,
      date: "2021.09.13",
      mileage: 190571,
      volume: 35.26,
      price: 15793,
    },
    {
      key: 4,
      date: "2021.09.28",
      mileage: 190947,
      volume: 33.53,
      price: 14000,
    },
  ];
  return (
    <View style={styles.container}>
      <h1>Eddigi tankol√°said:</h1>
      {fuelUp.map(
        (r) => (
          <CustomComponent FuelUp={r} PreviousFuelUp={prevFuelUp} />
        ),
        (prevFuelUp = r)
      )}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "top",
  },
  top: {
    flex: 0.3,
    backgroundColor: "#6c757d",
    borderRadius: 20,
    width: 1000,
    marginBottom: 10,
  },
  text: {
    color: "#fff",
    fontSize: 40,
  },
});
